    constructor(props){
        super(props);
    }
    render(){
        return(<div id="menuOptions" class="menu_items hideMenu">
                </div>
        )
    }
}

MenuOptions.defaultProps={
    opciones : [{
        name: "Home",
        link: "#"
    }, 
    {
        name: "Characters",
        link: "#characterSection"
    }, 
    {
        name: "Islands",
        link: "#islandSection"
